import { useEffect } from "react";

import { scrapeHtmlWeb } from "scrape-html-web";

function App() {
  useEffect(() => {
    async function enterCodeforces() {
      let base: string = "https://codeforces.com";
      let cf_enter: string = base + "/enter";
      console.log(cf_enter);

      const data = await scrapeHtmlWeb({
        url: cf_enter,
        bypassCors: true,
        mainSelector: ".blog-index",
        childrenSelector: [
          { key: "date", selector: "meta", type: "text" },
          // by default, the first option that is taken into consideration is att
          { key: "version", selector: "a", type: "text" },
          { key: "link", selector: "a", attr: "href" },
        ],
      });

      console.log(data);
    }
    enterCodeforces();
  }, []);

  return <main></main>;
}

export default App;
